import React from "react";
import Crysta from "../Images/cryy.jpg";

const CabDetails = () => {
  return (
    <div className="mt-10 mx-auto max-w-6xl px-4">
      <h2 className="text-2xl font-bold text-gray-800 mb-6">Toyota Innova</h2>
      
      <div className="flex bg-blue-50 p-6 rounded-lg shadow-md">
        <div className="w-2/5">
          <img
            src={Crysta}
            alt="Toyota Innova"
            className="w-full h-full object-cover rounded-lg"
          />
        </div>
        <div className="w-3/5 pl-6">
          <ul className="list-disc list-inside space-y-2 text-gray-700">
            <li>Air Conditioned Luxury SUV</li>
            <li>Comfortable & Spacious Seating</li>
            <li>Female Passenger Safety Standards</li>
          </ul>
        </div>
      </div>
    </div>
  );
};

export default CabDetails;
